(4, 'FAQ', 'faq', 'Page', 'faq', 'faq', 'faq', 'faq', '<!DOCTYPE html>\r\n<html>\r\n<style>\r\n.headtxt {\r\n	background-color: #ffe6e6;\r\n	font-size: 18px;\r\n}\r\n</style>\r\n<head>\r\n</head>\r\n<body>\r\n<section class="contentArea">\r\n<div class="container">\r\n<div class="row">\r\n<div class="col-md-12">\r\n<p>Welcome to <a href="http://www.palcura.com">Palcura </a>- a new comprehensive pet care platform connecting pet owners, sitters, and borrowers. Need to board your dog? Need someone to watch your cat while you are out? Tired of kennel services? Whether you are an owner, a sitter, or looking to borrow a pet for few days, we have you covered. At PalCura, owners can connect with top quality dog walkers, or connect with sitters who can provide home boarding services for your pet. If you love pets, but have doubts of what kind of pet would suit your lifestyle, or just not sure if you can handle a pet, you can borrow a trained dog from an owner, and see the bright future ahead! Take the first step towards the magical world of <a href="https://www.petfinder.com/" target="_blank">pet adoption</a> and ownership.</p>\r\n<p>Following sections will cover most of the basic questions that you may have as a Pet Sitter, Pet Owner or a Pet Borrower. We encourage you to browse through our FAQ&rsquo;s and if you have further questions, you can always send us a woof and we will get back to you in 24 hours!</p>\r\n</div>\r\n</div>\r\n<div class="row">\r\n<div class="col-xs-12">\r\n<div class="bottom3">\r\n<h3 class="orangeBtn">General questions</h3>\r\n<div class="twoCol">\r\n<h3 class="headtxt">How do I switch profiles or SIGN UP AS a DIFFERENT PROFILE</h3>\r\n<p><a href="../../../site/signup" target="_blank">Sign up</a> and switching between profiles is easy and quick! If you are an existing Pet Owner, or a Pet Sitter, or a Pet Borrower and you need to switch profiles or sign up as one, you can follow these three easy steps:</p>\r\n<div class="col-xs-12">\r\n<ul>\r\n<li>\r\n<p>1. Sign in, and go to &ldquo;Your Profile&rdquo;</p>\r\n<span class="faqImg"><img src="images/genq1.png" alt="" /></span></li>\r\n<li>\r\n<p>2. If you are already signed up as a Sitter, click on &ldquo;Access Sitter Profile&rdquo; to access your Sitter profile. If you an owner and want to become a sitter, then click on &ldquo;Become a Sitter&rdquo; to sign up as a sitter. If you need to sign up as a borrower, you can click on &ldquo;Become a Borrower&rdquo; or if you are already a borrower, you can click on &ldquo;Access Borrower profile&rdquo;.</p>\r\n<span class="faqImg"><img src="images/genq2.png" alt="" /></span></li>\r\n<li>\r\n<p>3. If you selected &ldquo;Become a Sitter&rdquo; or &ldquo;Become a Borrower&rdquo;, you will be presented with a form. After you fill in the form, you will be signed up as that profile. By following the aforementioned steps, you can always keep switching between profiles and search for the pet care or accept a pet care service.</p>\r\n</li>\r\n</ul>\r\n</div>\r\n<h3 class="headtxt">What&rsquo;s the image and video upload size limitations?</h3>\r\n<p>We currently allow for image uploads up to 5MB per image and video uploads up to 10MB per video. Based on the demand we will increase the limitations in the future.</p>\r\n<h3 class="headtxt">What&rsquo;s a dashboard?</h3>\r\n<p>A <a href="../../../users/dashboard" target="_blank">Dashboard</a>, is an easy to use tool designed for owners, sitters, and borrowers to view and post pet activities. You can learn more about dashboard by browsing through the content in the relevant profile sections mentioned below.</p>\r\n<h3 class="headtxt">Who sets the prices and what''s the service rate?</h3>\r\n<p>Services are provided by Pet Sitters, and or Owners who are willing to share the love of their pet with Pet Borrowers. Service rates/prices are set by these service providers and is at their discretion. We as PalCura, charge 15% of the service rate charged by service providers and disburse the remaining to the service providers after the service is completed. As a thank you for caring for Pets, we also offer Pet sitters a life time discount of 1.5% on our fees after they have completed 50 or more service days. At PalCura, we believe that caring for pet should be rewarded and for every $1 spent by owners/ borrowers, we reward them with 1 point. Please see "<a href="../../../cms/page/why-palcura" target="_blank">Why PalCura</a>" to learn more and how to use the accumulated points as credits towards next care service!</p>\r\n<h3 class="headtxt">Does PalCura have a privacy policy?</h3>\r\n<p>Yes, we do. Before you successfully sign up as a Pet sitter, Pet owner or as a Pet borrower, you will be required to accept our terms and conditions and privacy policy. <a href="../../../cms/page/terms-and-conditions" target="_blank">Terms and Conditions</a> are available in our sign up form page as well as at the bottom of our main site and in this FAQ section. Our <a href="../../../cms/page/privacy-policy" target="_blank">Privacy Policy</a>&nbsp;document is available in the sign up form page and in this FAQ section.</p>\r\n<h3 class="headtxt">What''s the cancellation policy</h3>\r\n<p>Cancellations requested at least 24 hours prior to the appointment will be refunded in full. Cancellations requested within 24 hours will be refunded except for a transaction fee of 6% to offset our payment processing expense. Please read our <a href="../../../cms/page/terms-and-conditions" target="_blank">Terms and Conditions</a> for more information.</p>\r\n<h3 class="headtxt">How do we contact PalCura?</h3>\r\n<p>You can reach us by sending us an email using our <a href="../../../site/contact" target="_blank">Contact</a> form. After you send us a message, we will get back to you in one business day. We are here to help, so rest assured your emails will be answered.</p>\r\n<h3 class="headtxt">How do I sign up?</h3>\r\n<p>You can sign up as a sitter, owner, or as a borrower by following these <strong>3 easy steps:</strong></p>\r\n<div class="col-xs-12">\r\n<ul>\r\n<li>\r\n<p>1. Click on &ldquo;<a href="../../../site/signup" target="_blank">Sign Up</a>&rdquo;</p>\r\n</li>\r\n<li>\r\n<p>2. Select one of the available options in &ldquo;Sign up as *&rdquo; drop down. If you are a pet owner who is also interested in Pet sitting then you can sign up as an owner, access &ldquo;Your Profile&rdquo; and &ldquo;Sign up as a Sitter&rdquo;. You can always switch between the profiles by a single click!</p>\r\n</li>\r\n<li>\r\n<p>3. Fill out the form, especially the required fields (marked *) and click on &ldquo;Save&rdquo;. You will receive a confirmation email. If you signed up as a sitter, we (PalCura) will do an offline check of the form details, your house pictures and provide you the verification badge. Once you receive the verification badge, you will be listed in the search results.</p>\r\n</li>\r\n</ul>\r\n</div>\r\n<h3 class="headtxt">How do i sign out?</h3>\r\n<p>You can sign out of the website by clicking on the small &ldquo;drop&rdquo; icon as shown below and click on &ldquo;Sign Out&rdquo;</p>\r\n<span class="faqImg"><img src="images/genq3.png" alt="" /></span></div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class="row">\r\n<div class="col-xs-12">\r\n<div class="bottom3">\r\n<h3 class="orangeBtn">Pet Sitter</h3>\r\n<div class="twoCol">\r\n<div class="row">\r\n<div class="col-lg-4 col-md-6 col-sm-6 col-xs-12"><img src="images/sitterpic.png" alt="" /></div>\r\n<div class="col-lg-8 col-md-6 col-sm-6 col-xs-12">\r\n<div class="rightColorCol">\r\n<p>&ldquo;Money can buy you a fine dog, but only love can make him wag his tail&rdquo; &ndash;<strong> Kinky Friedman</strong></p>\r\n<p>&ldquo;Time spent with cats is never wasted&rdquo;- <strong>Sigmund Freud</strong></p>\r\n<p>&ldquo;Until one has loved an animal a part of one&rsquo;s soul remains unawakened&rdquo; &ndash; <strong>Anatole France</strong></p>\r\n</div>\r\n</div>\r\n</div>\r\n<h3 class="headtxt">How do I sign up as a pet sitter?</h3>\r\n<p>Welcome to PalCura and thank you for taking the first step towards caring &amp; sharing! Signing up as a Pet Sitter is free and easy! To sign up, follow these simple steps:</p>\r\n<div class="col-xs-12">\r\n<ul>\r\n<li>\r\n<p>1. Go to <a href="www.palcura.com">www.palcura.com</a> and click on &ldquo;Sign up&rdquo; (Upper Right corner)</p>\r\n<span class="faqImg"><img src="images/img.png" alt="" /></span></li>\r\n<li>\r\n<p>2. Use your existing email address and fill out the sign up form for us to align you with the required services better.</p>\r\n</li>\r\n<li>\r\n<p>3. You will need to upload a minimum of 2 pictures of your house and yourself, along with an ID and provide the pet services you are willing to offer with price per day.</p>\r\n<span class="faqImg"><img src="images/house.png" alt="" /></span></li>\r\n</ul>\r\n</div>\r\n<p>After you fill out the details, <strong>we will get back to you in 1 business day and create a verification stamp for you</strong>. This will ensure the owners that you have been verified by PalCura and help them feel secure.</p>\r\n<h3 class="headtxt">How do I earn money?</h3>\r\n<p>As a Pet Sitter, you will decide your own rate/price for your pet services. For e.g. you can charge $25 per night or $25 per day/hour. Your Total earnings would be the rate times the number of hours/days/nights of pet services you provide, minus our service fees. Our Service fees are lowest in the industry. More importantly, after 50 days of sitting/walking and other pet services, you will automatically become PalCura VIP family member, and get a 1.5% discount on our service fees for life! This means, more money in your pocket!</p>\r\n<p>You can request to have your earnings transferred to your connected bank or Pay Pal account, or use the earnings as credit towards services that you may need in the future!. For e.g. if you ever need sitting services for your own pet, you can use the credits towards reserving the services for your pet. For all <strong>payments that need to be disbursed, a PayPal ID is required</strong>. Following steps details on how you can get paid :</p>\r\n<ol>\r\n<li>\r\n<p>After an owner reserves a pet care service and you provide the service, you will see the option of ''Request Payment'' under ''Payments'' menu.</p>\r\n</li>\r\n<li>\r\n<p><span class="faqImg">If you haven''t already added your PayPal ID, you will be prompted to enter the PayPal ID. You can always be proactive and add the PayPal ID by going to ''Your Profile'' menu and clicking on ''Edit Profile''. You will see the section to enter your PayPal ID</span></p>\r\n</li>\r\n<li>\r\n<p>After you enter your PayPal ID, payment will be disbursed to your PayPal account in the next 2-3 business days.</p>\r\n<h3 class="headtxt">Will my address be displayed in the search results?</h3>\r\n<p>Absolutely not. We need your address to place you within search radius of the owner. We will not share the address until the owner has agreed to reserve for their pet. Owners will only see an approximate radius of your residence, so that they can locate nearby service providers.</p>\r\n<h3 class="headtxt">Is there a way for me to connect with Owner before I confirm their reservation?</h3>\r\n<p>Yes; you can use our online integrated video conference service to schedule an online meet and greet. For security reasons, we have restricted the video call for 10 minutes. You can also send messages through our platform. We know life can be busy, and our integrated video call allows the two parties to connect, feel comfortable, and reserve for the pet service.</p>\r\n<p>Owners may want to also schedule an in person meet and greet. Meeting in person provides an assurance to both parties and we encourage the same.</p>\r\n<h3 class="headtxt">Can I search for an owner and proactively market my sitting, walking and other pet services to near by owners?</h3>\r\n<p>Unfortunately, as of this moment, we only allow for owners to search for Pet services; however, as a sitter, you are encouraged to use the &ldquo;Your Pitch&rdquo; section, along with your uploaded pictures to market yourself. If you provide exceptional care services for owner&rsquo;s pet, the owner will give you the highest ratings and you will be placed in the top search results. Additionally, after you provide 50 days of services, you will be entered in our VIP program, and we will list you in the top search results. You can also get yourself <a href="https://www.petsit.com/certification" target="_blank">certified </a>&nbsp;and use your certification in the pitch line of your profile to stand out</p>\r\n<h3 class="headtxt">What if I am also a Pet Owner and would like to search for sitter myself. Can I do that?</h3>\r\n<p>Sure! You can sign up and switch between profiles by following these 3 easy steps:</p>\r\n<div class="col-xs-12">\r\n<ul>\r\n<li>\r\n<p>1. Sign in, and click on &ldquo;Your Profile&rdquo; as shown below:</p>\r\n<span class="faqImg"><img src="images/searchpet.png" alt="" /></span></li>\r\n<li>\r\n<p>2. Click on &ldquo;Become an Owner&rdquo;, and fill out the form. After you save the details, you will be signed in as an &ldquo;Owner&rdquo;</p>\r\n<span class="faqImg"><img src="images/becomeowner.png" alt="" /></span></li>\r\n<li>\r\n<p>3. If you are already an Owner, and would like to switch from your Sitter profile to Owner profile, you can click on &ldquo;Access Owner Profile&rdquo; and you will be signed in as an &ldquo;Owner&rdquo;. You are now ready to search for near-by pet sitters, by going to the home page and clicking on &ldquo;Find Loving Pet Care&rdquo;</p>\r\n<span class="faqImg"><img src="images/lovingpetcare.png" alt="" /></span></li>\r\n</ul>\r\n</div>\r\n</li>\r\n</ol></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class="container">\r\n<div class="row">\r\n<div class="col-xs-12">\r\n<div class="bottom3">\r\n<h3 class="orangeBtn">Pet Owner</h3>\r\n<div class="twoCol">\r\n<div class="row">\r\n<div class="col-lg-4 col-md-6 col-sm-6 col-xs-12">\r\n<div class="sthumb"><img src="images/ownerpic.png" alt="" /></div>\r\n</div>\r\n<div class="col-lg-8 col-md-6 col-sm-6 col-xs-12">\r\n<div class="rightColorCol">\r\n<p>&ldquo;My Little dog &ndash; a heartbeat at my feet&rdquo; <strong>&ndash; Edith Wharton</strong></p>\r\n<p>&ldquo;If animals could speak, the dog would be a blundering outspoken fellow; but the cat would have the rare grace of never saying a word too much&rdquo; <strong> &ndash; Mark Twain</strong></p>\r\n<p>&ldquo;Birds are the best pets around&rdquo; <strong>&ndash; Bird</strong></p>\r\n</div>\r\n</div>\r\n</div>\r\n<h3 class="headtxt">How do I sign up as a Pet Owner?</h3>\r\n<p>Welcome to PalCura and thank you for taking the first step towards caring &amp; sharing! Signing up as a Pet Owner is free and easy! To sign up, follow these simple steps:</p>\r\n<div class="col-xs-12">\r\n<ul>\r\n<li>\r\n<p>1. Go to <a href="www.palcura.com">www.palcura.com</a> and click on &ldquo;Sign up&rdquo; (Upper Right corner)</p>\r\n<span class="faqImg"><img src="images/img.png" alt="" /></span></li>\r\n<li>\r\n<p>2. Use your existing email address and fill out the sign up form for us to align you with the required services better.</p>\r\n</li>\r\n<li>\r\n<p>3. You will be asked if you are interested in renting your pet for future pet owners to help them gain confidence. If you chose to say yes, you will be asked to fill out your pet details and set up your price (price to lend your pet and share the love)</p>\r\n</li>\r\n<li>\r\n<p>4. You will be asked to fill out additional details associated with your pet and your pet&rsquo;s vaccination. This is a crucial required step and helps provide sitters the confidence in caring for your pet.</p>\r\n</li>\r\n<li>\r\n<p>5. <strong>You are now ready to search for near-by pet sitters</strong> and pet service providers. We encourage you to create a detailed profile of your dog along with care notes. Providing details helps service providers understand your pet needs, food habits and gives you one less reason to worry!</p>\r\n</li>\r\n</ul>\r\n</div>\r\n<h3 class="headtxt">Tell me more about Pet Borrowing</h3>\r\n<p>Thank you for considering lending your pet and helping us towards our mission of increasing pet ownership. Borrowing a pet program is aimed towards families that hesitate in getting a pet because they are not sure if they can handle the lifestyle commitment of a pet. Many are not sure of the kind/breed of pet that suits their living conditions and lifestyles or many live away from their family pet and miss the wag of a tail when they get home. We understand! Feeling the murmur of a purr beneath your fingers and holding a furry warm companion close, brings instant contentment.</p>\r\n<p>To enroll yourself as a PalCura pet lender, you can follow the below three easy steps and you will be contacted by Pet Borrowers who are looking for folks like you to share the pet love:</p>\r\n<div class="col-xs-12">\r\n<ul>\r\n<li>\r\n<p>1. Sign in, and go to &ldquo;Your Profile&rdquo;.</p>\r\n</li>\r\n<li>\r\n<p>2. Click &ldquo;Edit Profile&rdquo; and look for the question that reads &ldquo;Interested in renting your pet to future pet owners and help them gain confidence?&rdquo; Select yes, fill out the details associated with your pet and set your price.</p>\r\n</li>\r\n<li>\r\n<p>3. Save the settings and are you all set! You will be notified when someone is ready to borrow your pet</p>\r\n</li>\r\n</ul>\r\n</div>\r\n<h3 class="headtxt">Can I become a pet sitter?</h3>\r\n<p>Absolutely. Signing up as PalCura Pet Sitter is easy and free. As a Pet Sitter, you can also offer additional services such as Dog walking, pet day care, Pet Grooming etc. Follow the below easy three step process to sign up as a Pet Sitter:</p>\r\n<div class="col-xs-12">\r\n<ul>\r\n<li>\r\n<p>1. Sign in, and go to &ldquo;Your Profile&rdquo;.</p>\r\n</li>\r\n<li>\r\n<p>2. Look for the option that reads &ldquo;Become a Pet Sitter&rdquo;. You will be required to upload your room pictures, ID, and any additional pictures that you would like to share. Once you upload the pictures and ID, make sure to save your settings.</p>\r\n</li>\r\n<li>\r\n<p>3. That&rsquo;s it! You are on your way to becoming a Pet Sitter. We will get back to you in one business day with the verification stamp that will ensure your listing in the search results.</p>\r\n</li>\r\n</ul>\r\n</div>\r\n<h3 class="headtxt">What If I am no longer interested in providing sitting services?</h3>\r\n<p>Well, we hope you would reconsider the decision; however, if you are no longer interested in sitting services, you can remove yourself from the listing, by following these steps:</p>\r\n<div class="col-xs-12">\r\n<ul>\r\n<li>\r\n<p>1. Sign in, and go to &ldquo;Your Profile&rdquo;.</p>\r\n</li>\r\n<li>\r\n<p>2. Click on &ldquo;Unsubscribe/Subscribe&rdquo;. You can select which profile you would like to unsubscribe to:</p>\r\n<span class="faqImg"><img src="images/subscribeun.png" alt="" /></span></li>\r\n<li>\r\n<p>3. Save and you are all set. You will no longer be listed in the search results.</p>\r\n</li>\r\n</ul>\r\n</div>\r\n<h3 class="headtxt">How can I be sure that a sitter is good enough to take care of my pet?</h3>\r\n<p>Each sitter goes through a background check before they are verified and listed in the search results. You can also set up a video call with the sitter through our integrated secured video chat to ensure both parties feel comfortable with each other. We also encourage you to set up an in person meeting with the sitter to get yourself and your pet familiarized with the new environment.</p>\r\n<h3 class="headtxt">How do I set up a video chat with a sitter or borrower?</h3>\r\n<p>After you sign in, search for nearby sitters, and find one that meets your criteria, you have three options:</p>\r\n<div class="col-xs-12">\r\n<ul>\r\n<li>\r\n<p>A. Send a message</p>\r\n</li>\r\n<li>\r\n<p>B. Set up a video chat</p>\r\n</li>\r\n<li>\r\n<p>C. Book</p>\r\n</li>\r\n</ul>\r\n</div>\r\n<p>To set up a video chat:</p>\r\n<div class="col-xs-12">\r\n<ul>\r\n<li>\r\n<p>1. Select the sitter and click on View Profile or Quick View.</p>\r\n</li>\r\n<li>\r\n<p>2. Click on &ldquo;Schedule a Video chat&rdquo;</p>\r\n</li>\r\n<li>\r\n<p>3. Choose the date and time , provide a description and click on &ldquo;Request&rdquo;</p>\r\n<span class="faqImg"><img src="images/videoschedule.png" alt="" /></span></li>\r\n<li>\r\n<p>4. The Sitter, will receive an email notification and once the sitter approves the request, you will be notified.</p>\r\n</li>\r\n<li>\r\n<p>5. On the day of scheduled video chat, login to PalCura, and go to &ldquo;Video Calls&rdquo; section</p>\r\n</li>\r\n<li>\r\n<p>6. Click on &ldquo;Accept/Decline&rdquo;, and then click on &ldquo;Confirm&rdquo;</p>\r\n<span class="faqImg"><img src="images/videolisting.png" alt="" /></span></li>\r\n<li>\r\n<p>7. You can then click on &ldquo;Make a call&rdquo; and the owner will be notified to come online. If the owner clicks on &ldquo;Make a call&rdquo;, you will be notified to come online. Once both parties are logged in and online, the video call session will be established. For security reasons we have limited the session to 10 minutes and you are only allowed to have one video call session per sitter/owner/borrower.</p>\r\n</li>\r\n</ul>\r\n</div>\r\n<h3 class="headtxt">How do I send a message to a sitter or borrower?</h3>\r\n<p>After you sign in, search for nearby sitters, and find one that meets your criteria, you have three options:</p>\r\n<div class="col-xs-12">\r\n<ul>\r\n<li>\r\n<p>A. Send a message</p>\r\n</li>\r\n<li>\r\n<p>B. Set up a video chat</p>\r\n</li>\r\n<li>\r\n<p>C. Book</p>\r\n</li>\r\n</ul>\r\n</div>\r\n<p>To send a message to a Pet Sitter:</p>\r\n<div class="col-xs-12">\r\n<ul>\r\n<li>\r\n<p>1. Select the reservation in the &ldquo;Booking&rdquo; section and click on Quick View or View details</p>\r\n</li>\r\n<li>\r\n<p>2. Click on &ldquo;Send a Message&rdquo;</p>\r\n</li>\r\n<li>\r\n<p>3. You can check your received messages under the &ldquo;Messages&rdquo; section. We will also notify you when you receive a new message.</p>\r\n</li>\r\n</ul>\r\n</div>\r\n<h3 class="headtxt">Is there a charge towards boarding services?</h3>\r\n<p>Our network of Pet Sitters would set their own rate and you can choose sitters based on your preference and rate. For every dollar you spend, you will earn one point and for every 500 points you earn, you will get $5 credit towards your next pet sitting reservation request. Please visit &ldquo;About PalCura&rdquo; page on our site to learn more on our loyalty and points program.</p>\r\n<h3 class="headtxt">Can I earn money by lending my pet?</h3>\r\n<p>Yes. Because you are providing a service by lending your pet, you get to enter your price/rate for your services. Pet Borrowers will be charged accordingly. Your net earnings would be the total price for the hours or days you lend your pet minus our 15% service fee, which is the lowest in the industry.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class="row">\r\n<div class="col-xs-12">\r\n<div class="bottom3">\r\n<h3 class="orangeBtn">Pet Borrower</h3>\r\n<div class="twoCol">\r\n<div class="row">\r\n<div class="col-lg-4 col-md-6 col-sm-6 col-xs-12">\r\n<div class="sthumb"><img src="images/boorrowepic.png" alt="" /></div>\r\n</div>\r\n<div class="col-lg-8 col-md-6 col-sm-6 col-xs-12">\r\n<div class="rightColorCol">\r\n<p>&ldquo;Before you get a dog, you can&rsquo;t imagine what living with one might be like; afterward, you can&rsquo;t imagine living any other way&rdquo;<strong>&ndash; Caroline Knapp</strong></p>\r\n<p>&ldquo;I used to love dogs until I discovered cats.&rdquo; <strong>&ndash; Nafisa Joseph</strong></p>\r\n<p>&ldquo;There are many reasons why so many of us choose to share our lives with a pet--it''s the perfect antidote for loneliness, providing an endless supply of smiles and the certainty of unwavering companionship, and many of us have seen the way a pet can make a family feel whole&rdquo;<strong>- Nick Trout</strong></p>\r\n</div>\r\n</div>\r\n</div>\r\n<h3 class="headtxt">How do I sign up as Pet Borrower?</h3>\r\n<p>Welcome to PalCura and thank you for taking the first step towards caring &amp; sharing! Adopting or buying a pet is a huge step in your life. We make this easy for you through our Borrow a pet program. Our pet borrowing program is designed to connect you with pets in the neighborhood...be it for few days or to just play and take to the park.</p>\r\n<p>When you rent a pet from existing owner, you get the comfort in the fact that the pet is well behaved, has been well taken care of by the owner. You get to see the future now! Someone is always looking to fill the pet void in their life by spending time with one and they can help out owners at the same time. It''s a win-win! We hope by this program, we will have more number of families that adopt pets from pet shelters. Because we know...once you have had the love of a pet, you always want more ?. <strong><br /></strong></p>\r\n<p><strong>To sign up as a borrower, follow these three easy steps:</strong></p>\r\n<div class="col-xs-12">\r\n<ul>\r\n<li>\r\n<p>1. Go to <a href="www.palcura.com">www.palcura.com</a> and click on &ldquo;Sign up&rdquo; (Upper Right corner)</p>\r\n<span class="faqImg"><img src="images/img.png" alt="" /></span></li>\r\n<li>\r\n<p>2. Use your existing email address and fill out the sign up form for us to align you with the required services better.</p>\r\n</li>\r\n<li>\r\n<p>3. You are all set and ready to search for near-by Pet Owners who are willing to lend their pet.</p>\r\n</li>\r\n</ul>\r\n</div>\r\n<h3 class="headtxt">What if I am an existing Pet Owner? Can I sign up as Pet Borrower?</h3>\r\n<p>Absolutely yes! You can borrow/rent a pet to give your existing pal a company or add to your weekend fun! Follow the sign up process and you will be ready to search for near-by pet owners who are willing to lend their pet. If you have already signed in as an owner, you can go to &ldquo;Your Profile&rdquo; section, select &ldquo;Become a Pet Borrower&rdquo; and fill out some details.</p>\r\n<h3 class="headtxt">Wouldn&rsquo;t I rather be a foster Pet parent, then borrowing a pet?</h3>\r\n<p>Fostering a pet is a wonderful idea and we encourage you to do so. PalCura&rsquo;s Pet borrowing program is meant for folks who would rather prefer to have a well-trained pet and experiment with specific pet types that would suit their lifestyle before taking that leap towards pet ownership. At PalCura, we believe that by spending time with someone&rsquo;s lovely well-trained dog, cat, or bird would give you a vision towards your future life that would be full of joy and happiness. If you have a pet that pees or poops in your house, you may get discouraged and may regret getting a pet. We would rather have you experience a home trained pet, so that you can make an informed decision towards ownership.</p>\r\n<h3 class="headtxt">How do I set up a video chat with an owner</h3>\r\n<p>After you sign in, search for nearby owners, and find one that meets your criteria, you have three options:</p>\r\n<div class="col-xs-12">\r\n<ul>\r\n<li>\r\n<p>A. Send a message</p>\r\n</li>\r\n<li>\r\n<p>B. Set up a video chat.</p>\r\n</li>\r\n<li>\r\n<p>C. Book</p>\r\n</li>\r\n</ul>\r\n</div>\r\n<p>To set up a video chat</p>\r\n<div class="col-xs-12">\r\n<ul>\r\n<li>\r\n<p>1. Select the Pet Owner and click on View Profile or Quick View.</p>\r\n</li>\r\n<li>\r\n<p>2. Click on &ldquo;Schedule a Video chat&rdquo;</p>\r\n</li>\r\n<li>\r\n<p>3. Choose the date and time , provide a description and click on &ldquo;Request&rdquo;</p>\r\n<span class="faqImg"><img src="images/borrowervid.png" alt="" /></span></li>\r\n<li>\r\n<p>4. Once the owner approves the request, you are all set.</p>\r\n</li>\r\n<li>\r\n<p>5. On the day of scheduled video chat, login to PalCura, and go to &ldquo;Video Calls&rdquo; section. Click on &ldquo;Accept/Decline&rdquo; button</p>\r\n<span class="faqImg"><img src="images/borrowervidlist.png" alt="" /></span></li>\r\n<li>\r\n<p>6. In the Booking area, select the Owner, and click on &ldquo;Start the Video&rdquo;</p>\r\n</li>\r\n<li>\r\n<p>7. If the Owner is not online, feel free to send them a message. The video chat session will be held for the day.</p>\r\n</li>\r\n</ul>\r\n</div>\r\n<h3 class="headtxt">How can I sign up as a Pet Owner or a Pet Sitter?</h3>\r\n<p>You can switch profiles in three easy steps as follows:</p>\r\n<div class="col-xs-12">\r\n<ul>\r\n<li>\r\n<p>1. Login as a borrower and go to &ldquo;Your Profile&rdquo; section</p>\r\n</li>\r\n<li>\r\n<p>2. Select &ldquo;Become a Sitter&rdquo; or &ldquo;Become an owner&rdquo;</p>\r\n<span class="faqImg"><img src="images/becomesit.png" alt="" /></span></li>\r\n<li>\r\n<p>3. Select the option &ldquo;Become an Owner&rdquo; or &ldquo;Become a Sitter&rdquo;, fill out required details, and save.</p>\r\n</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n</body>\r\n</html>', '2018-04-22 06:19:04', 'Active', ''),
