(7, 'Blog', 'Blog', 'Page', '', '', 'blog', '', '<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<section class="contentArea">\r\n<div class="container">\r\n<div class="row">\r\n<div class="col-md-12">\r\n<h4>Coming soon..</h4>\r\n<!--div class="borderbottom">\r\n<div class="highlights">\r\n<h2>H2-standard heading</h2>\r\n<p class="Highlighted">Paragraph-Highlighted. Proin gravida nibh vel velit auctor aliquet. Aenean sollicitudin, lorem quis bibendum auctor.</p>\r\n</div>\r\n<div class="sthumb"><img src="images/img-1.png" alt="" /></div>\r\n<p>Standard paragraph-01. Proin gravida nibh vel velit auctor aliquet. Aenean sollicitudin, lorem quis bibendum auctor, nisi elit consequat ipsum, nec sagittis sem nibh id elit. Duis sed odio sit amet nibh vulputate cursus a sit amet mauris. Morbi accumsan ipsum velit. Nam nec tellus a odio tincidunt auctor a ornare odio. Sed non mauris vitae erat consequat auctor eu in elit.</p>\r\n<p>Class aptent taciti sociosqu ad litora torquent per conubia nostra, per inceptos himenaeos. Mauris in erat justo.</p>\r\n</div>\r\n</div--></div>\r\n</div>\r\n</div>\r\n</section>\r\n</body>\r\n</html>', '2018-03-01 10:02:45', 'Active', '');
