(10, 'Terms and Conditions', 'tearmsandconditions', 'Page', '', '', 'Terms-and-Conditions', '', '<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<section class="contentArea">\r\n<div class="container">\r\n<div class="row">\r\n<div class="col-xs-12">\r\n<div class="bottom3">\r\n<h2 class="Highlighted" style="text-align: center;">The Terms and Conditions below are effective for all users</h2>\r\n<h2 class="Highlighted" style="text-align: center;">(Last Updated on October 1, 2017)</h2>\r\n</div>\r\n</div>\r\n</div>\r\n<div class="row">\r\n<div class="col-xs-12">\r\n<div class="bottom3">\r\n<h3>PalCura, LLC User Terms and Conditions</h3>\r\n<p>PalCura, LLC is an online marketplace that connects pet owners, pet sitters, and other providers of pet-oriented services, including but not limited to clean up services, pet trainers, and veterinarians. Please read these Terms and Conditions ("Terms", "Terms and Conditions") carefully before using the www.palcura.com website and the PalCura mobile application (together, or individually, the "Service") operated by PalCura, LLC, a limited liability company formed under the laws of the state of Florida (&ldquo;PalCura&rdquo;, &ldquo;us&rdquo;, &ldquo;we&rdquo;, or &ldquo;our&rdquo;).</p>\r\n<p>Your access to and use of the Service is conditioned upon your acceptance of and compliance with these Terms. These Terms apply to all visitors, users and others who wish to access or use the Service.</p>\r\n<p>By accessing or using the Service you agree to be bound by these Terms. If you disagree with any part of the terms then you do not have permission to access the Service.</p>\r\n</div>\r\n<div class="bottom3">\r\n<h3>Communications</h3>\r\n<p>By creating an Account on our service, you agree to receive marketing or promotional materials and other information we may send. However, you may opt out of receiving any, or all, of these communications from us by following the unsubscribe link or instructions provided in any email we send.</p>\r\n</div>\r\n<div class="bottom3">\r\n<h3>Fees and Payment</h3>\r\n<p>We charge a percentage fee for every service booked through our platform, as detailed in website and mobile application. We reserve the right to change our fees at any time without notice prior to each booking confirmation. Fees paid are generally nonrefundable, however we reserve the right to refund certain amounts on a case by case basis, in our sole discretion. Services are offered and requested through our platform. We use a third-party payment processor, currently Braintree (a PayPal subsidiary), and third-party video conference provider, currently TokBox. Your use of this service and payment through the third party constitute your understanding and agreement that we are not responsible for any issues, problems, or losses experienced due to use of their platform. Additionally, you understand and acknowledge that transactions through third-party sites are governed by such sites&rsquo; terms and conditions. We encourage our users to read all terms of service and privacy policies for third-party providers. Providers of goods and services are responsible for all applicable taxes. Offline or cash payments are a violation of our Terms of Service, and can result in removal from PalCura.</p>\r\n<p>As a benefit to our users, we may offer a reward-based points system in which users accrue 1 point in their account per dollar spent through our platform. Users may apply up to 1% of their accrued points when they reach 500-point intervals to pay for additional goods and/or services through our platform at a $1/1-point rate. Points expire after 12 months of platform inactivity and may not be transferred or compiled from multiple accounts, even if those accounts belong to the same user. Users are responsible for any tax implications of point usage and are advised to seek guidance from a tax professional in their state. This reward program may be changed or cancelled at any time with or without notice at PalCura&rsquo;s sole discretion. Upon cancellation, there will be no cash value attributed to any remaining points.</p>\r\n</div>\r\n<div class="bottom3">\r\n<h3>Cancellations</h3>\r\n<p>Cancellations requested at least 24 hours prior to the appointment will be refunded in full. Cancellations requested within 24 hours will be refunded except for a transaction fee of 6% to offset our payment processing expense.</p>\r\n</div>\r\n<div class="bottom3">\r\n<h3>Content</h3>\r\n<p>Our Service allows you to post, link, store, share and otherwise make available certain information, text, graphics, videos, or other material ("Content"). You are responsible for the Content that you post on or through the Service, including its legality, reliability, and appropriateness.</p>\r\n<p>By posting Content on or through the Service, you represent and warrant that: (i) the Content is yours (you own it) and/or you have the right to use it and the right to grant us the rights and license as provided in these Terms, and (ii) that the posting of your Content on or through the Service does not violate the privacy rights, publicity rights, copyrights, contract rights or any other rights of any person or entity. We reserve the right to terminate the account of anyone found to be infringing on a copyright. You retain any and all of your rights to any Content you submit, post or display on or through the Service and you are responsible for protecting those rights. We take no responsibility and assume no liability for Content you or any third-party posts on or through the Service. However, by posting Content using the Service you grant us the right and license to use, modify, publicly perform, publicly display, reproduce, and distribute such Content on and through the Service. You agree that this license includes the right for us to make your Content available to other users of the Service, who may also use your Content subject to these Terms.</p>\r\n<p>The Company has the right but not the obligation to monitor and edit all Content provided by users and reserves the right to suspend and/or terminate the account of anyone found to have violated the Terms.</p>\r\n<p>In addition, Content found on or through this Service are the property of PalCura or used with permission. You may not distribute, modify, transmit, reuse, download, repost, copy, or use said Content, whether in whole or in part, for commercial purposes or for personal gain, without express advance written permission from us.</p>\r\n</div>\r\n<div class="bottom3">\r\n<h3>Conduct</h3>\r\n<p>At all times when using or accessing this Site, you agree that:</p>\r\n<ul>\r\n<li>\r\n<p>a. You are solely responsible for the content or information you publish or display (hereinafter, &ldquo;post&rdquo;) on the Site or transmit to other members.</p>\r\n</li>\r\n<li>\r\n<p>b. You will not post on the Site, or transmit to other members or PalCura employees, any defamatory, inaccurate, abusive, obscene, profane, offensive sexually oriented, threatening, harassing, racially offensive, or illegal material, or any material that infringes or violates another party&rsquo;s rights (including, but not limited to, intellectual property rights, and rights of privacy and publicity). Please contact us in writing if you believe any material contained in the Site does not comply with the foregoing.</p>\r\n</li>\r\n<li>\r\n<p>c. You will use the Site in a manner consistent with any and all applicable laws and regulations.</p>\r\n</li>\r\n<li>\r\n<p>d. You will not include in your profile any offensive or sexually suggestive references or post any photographs or other images containing nudity. PalCura reserves the right, but has no obligation, to remove without warning or refund any profile or photograph or image that does not comply with these prohibitions.</p>\r\n</li>\r\n<li>\r\n<p>e. You will maintain current contact information on your profile, including at least one main image. We reserve the right to add any image or edit any information at any time.</p>\r\n</li>\r\n<li>\r\n<p>f. You will not falsify your identity or misrepresent yourself in any way on the Site.</p>\r\n</li>\r\n<li>\r\n<p>g. You will not &ldquo;stalk&rdquo; or otherwise harass any person in any way.</p>\r\n</li>\r\n<li>\r\n<p>h. You will not engage in advertising to, or solicitation of, other members to buy or sell any products or services through the Site.</p>\r\n</li>\r\n<li>\r\n<p>i. You will not transmit any chain letters, spam or junk email to other members or to us.</p>\r\n</li>\r\n<li>\r\n<p>j. You will not express or imply that any statements you make are endorsed by us, without our specific prior written consent.</p>\r\n</li>\r\n<li>\r\n<p>k. You will not harvest or collect personal information about other members whether or not for commercial purposes, without our written consent.</p>\r\n</li>\r\n<li>\r\n<p>l. You will not use any robot, spider, site search/retrieval application, or other manual or automatic device or process to retrieve, index, &ldquo;data mine&rdquo;, &ldquo;scrape&rdquo; or in any way reproduce or circumvent the navigational structure or presentation of the Site or its contents.</p>\r\n</li>\r\n<li>\r\n<p>m. You will not post, distribute or reproduce in any way any copyrighted material, trademarks, or other proprietary information without obtaining the prior consent of the owner of such proprietary rights.</p>\r\n</li>\r\n<li>\r\n<p>n. You will not interfere with or disrupt our services or the Site, or the servers or networks connected to our services or the Site.</p>\r\n</li>\r\n<li>\r\n<p>o. You will not post html code except where instructed in any area of your profile on this Site.</p>\r\n</li>\r\n<li>\r\n<p>p. You will not post, email or otherwise transmit any material that contains software viruses or any other computer code, files or programs designed to interrupt, destroy or limit the functionality of any software, hardware or telecommunications equipment.</p>\r\n</li>\r\n<li>\r\n<p>q. You will not forge headers or otherwise manipulate identifiers in order to disguise the origin of any information transmitted through the Service.</p>\r\n</li>\r\n<li>\r\n<p>r. You will not &ldquo;frame&rdquo; or &ldquo;mirror&rdquo; any part of the Site, without our prior written authorization. You also shall not use meta tags or code or other devices containing any reference to our services or the Site in order to direct any person to any other website for any purpose.</p>\r\n</li>\r\n<li>\r\n<p>s. You will not modify, adapt, sublicense, translate, sell, reverse engineer, decipher, decompile or otherwise disassemble any portion of the Site or any software used on or for the Site or cause others to do so.</p>\r\n</li>\r\n<li>\r\n<p>t. You are solely responsible for your interactions with other members. PalCura reserves the right, but has no obligation, to monitor disputes between you and other members.</p>\r\n</li>\r\n<li>\r\n<p>u. PalCura has the right to temporarily suspend or permanently terminate the account of any member who posts contact information on the site in audio/video samples or messages to prospective clients. This contact information includes website URL links and addresses, email links and addresses, and telephone numbers.</p>\r\n</li>\r\n<li>\r\n<p>v. You will respond fully, truthfully, and within three (3) business days to any request for information or other inquiry from PalCura related to your or another member&rsquo;s compliance with these Terms.</p>\r\n</li>\r\n</ul>\r\n</div>\r\n<div class="bottom3">\r\n<h3>Accounts</h3>\r\n<p>When you create an account with us, you guarantee that you are above the age of 18, and that the information you provide us is accurate, complete, and current at all times. Inaccurate, incomplete, or obsolete information may result in the immediate termination of your account on the Service.</p>\r\n<p>You are responsible for maintaining the confidentiality of your account and password, including but not limited to the restriction of access to your computer and/or account. You agree to accept responsibility for any and all activities or actions that occur under your account and/or password, whether your password is with our Service or a third-party service. You must notify us immediately upon becoming aware of any breach of security or unauthorized use of your account.</p>\r\n</div>\r\n<div class="bottom3">\r\n<h3>Intellectual Property</h3>\r\n<p>The Service and its original content (excluding Content provided by users), features and functionality are and will remain the exclusive property of PalCura and its licensors. The Service is protected by copyright, trademark, and other laws of both the United States and foreign countries. Our trademarks and trade dress may not be used in connection with any product or service without our prior written consent.</p>\r\n</div>\r\n<div class="bottom3">\r\n<h3>Links To Other Web Sites</h3>\r\n<p>Our Service may contain links to third-party web sites or services that are not owned or controlled by PalCura. The Company has no control over, and assumes no responsibility for the content, privacy policies, or practices of any third-party web sites or services. We do not warrant the offerings of any of these entities/individuals or their websites.</p>\r\n<p>You acknowledge and agree that PalCura shall not be responsible or liable, directly or indirectly, for any damage or loss caused or alleged to be caused by or in connection with use of or reliance on any such content, goods or services available on or through any such third-party web sites or services.</p>\r\n<p>We strongly advise you to read the terms and conditions and privacy policies of any third-party web sites or services that you visit.</p>\r\n</div>\r\n<div class="bottom3">\r\n<h3>Termination</h3>\r\n<p>We may terminate or suspend your account and bar access to the Service immediately, without prior notice or liability, under our sole discretion, for any reason whatsoever and without limitation, including but not limited to a breach of the Terms.</p>\r\n<p>If you wish to terminate your account, you may simply discontinue using the Service.</p>\r\n<p>All provisions of the Terms which by their nature should survive termination shall survive termination, including, without limitation, ownership provisions, warranty disclaimers, indemnity and limitations of liability.</p>\r\n</div>\r\n<div class="bottom3">\r\n<h3>Intellectual Property</h3>\r\n<p>The Service and its original content (excluding Content provided by users), features and functionality are and will remain the exclusive property of PalCura and its licensors. The Service is protected by copyright, trademark, and other laws of both the United States and foreign countries. Our trademarks and trade dress may not be used in connection with any product or service without our prior written consent.</p>\r\n</div>\r\n<div class="bottom3">\r\n<h3>Indemnification</h3>\r\n<p>You agree to defend, indemnify and hold harmless PalCura and its licensee and licensors, and their employees, contractors, agents, officers and directors, from and against any and all claims, damages, obligations, losses, liabilities, costs or debt, and expenses (including but not limited to attorney''s fees), resulting from or arising out of a) your use and access of the Service, by you or any person using your account and password; b) a breach of these Terms, or c) Content posted on the Service.</p>\r\n</div>\r\n<div class="bottom3">\r\n<h3>Limitation Of Liability</h3>\r\n<p>In no event shall PalCura, nor its directors, employees, partners, agents, suppliers, or affiliates, be liable for any indirect, incidental, special, consequential or punitive damages, including without limitation, loss of profits, data, use, goodwill, or other intangible losses, resulting from (i) your access to or use of or inability to access or use the Service; (ii) any conduct or content of any third party on the Service; (iii) any content obtained from the Service; (iv) unauthorized access, use or alteration of your transmissions or content; and (v) any action or omission of any act by any party with whom any user contracts or interacts, whether it is a service provider, pet renter or pet owner whether based on warranty, contract, tort (including negligence) or any other legal theory, whether or not we have been informed of the possibility of such damage, and even if a remedy set forth herein is found to have failed of its essential purpose. You acknowledge that PalCura only provides a platform for users and service providers and does not vet, conduct background checks, or conduct any other review of users, service providers, or animals.</p>\r\n</div>\r\n<div class="bottom3">\r\n<h3>Disclaimer</h3>\r\n<p>Your use of the Service is at your sole risk. The Service is provided on an "AS IS" and "AS AVAILABLE" basis. The Service is provided without warranties of any kind, whether express or implied, including, but not limited to, implied warranties of merchantability, fitness for a particular purpose, non-infringement or course of performance.</p>\r\n<p>PalCura, its subsidiaries, affiliates, and its licensors do not warrant that a) the Service will function uninterrupted, secure or available at any particular time or location; b) any errors or defects will be corrected; c) the Service is free of viruses or other harmful components; or d) the results of using the Service will meet your requirements.</p>\r\n<p>Additionally, PalCura specifically disclaims all liability arising from the match and/or relationship of any users, whether they be Pet Owner, Pet Sitter, Pet Renter, Pet Lender, or other service provider. As a user of the service, you specifically acknowledge and agree that the Company is not responsible for the following:</p>\r\n<ul>\r\n<li>\r\n<p>1) User satisfaction with services obtained through our Service;</p>\r\n</li>\r\n<li>\r\n<p>2) Miscommunication between service providers and customers on our platform;</p>\r\n</li>\r\n<li>\r\n<p>3) Pet availability;</p>\r\n</li>\r\n<li>\r\n<p>4) Pet Sitter performance;</p>\r\n</li>\r\n<li>\r\n<p>5) Quality of customers or service providers;</p>\r\n</li>\r\n<li>\r\n<p>6) The demeanor or actions of any animal;</p>\r\n</li>\r\n<li>\r\n<p>7) Failure of any pet owner to retrieve pet;</p>\r\n</li>\r\n<li>\r\n<p>8) Pets lost while with any service user;</p>\r\n</li>\r\n<li>\r\n<p>9) Failure to adhere to local laws, ordinances, etc.</p>\r\n</li>\r\n<li>\r\n<p>10) Customer complaints; and</p>\r\n</li>\r\n<li>\r\n<p>11) Any agreements between parties, other than payments through our platform</p>\r\n</li>\r\n</ul>\r\n</div>\r\n<div class="bottom3">\r\n<h3>Governing Law</h3>\r\n<p>These Terms shall be governed and construed in accordance with the laws of Florida, United States, without regard to its conflict of law provisions. Any and all law suits brought against the Company shall be filed in the federal or state court of competent jurisdiction in Palm Beach County, Florida.</p>\r\n<p>Our failure to enforce any right or provision of these Terms will not be considered a waiver of those rights. If any provision of these Terms is held to be invalid or unenforceable by a court, the remaining provisions of these Terms will remain in effect. These Terms constitute the entire agreement between us regarding our Service, and supersede and replace any prior agreements we might have had between us regarding the Service.</p>\r\n</div>\r\n<div class="bottom3">\r\n<h3>Changes</h3>\r\n<p>We reserve the right, at our sole discretion, to modify or replace these Terms at any time. If a revision is material we will provide at least 30 days notice prior to any new terms taking effect. What constitutes a material change will be determined at our sole discretion.</p>\r\n<p>By continuing to access or use our Service after any revisions become effective, you agree to be bound by the revised terms. If you do not agree to the new terms, you are no longer authorized to use the Service.</p>\r\n</div>\r\n<div class="bottom3">\r\n<h3>Contact Us</h3>\r\n<p>If you have any questions about these Terms, please contact us at:</p>\r\n<p>PalCura , LLC <br /> 160 W. Camino Real<br /> Unit #533<br /> Boca Raton, FL 33432<br /> Or email us at <a class="contentct" href="mailto:hello@palcura.com">hello@palcura.com</a></p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n</body>\r\n</html>', '2018-04-14 04:08:37', 'Active', ''),
(11, 'Why PalCura', 'Why PalCura for Pet sitting', 'Page', 'Dog Walking Pet Sitting Boarding by PalCura', 'Sitting and overnight boarding through PalCura', 'why-palcura', 'Easy three steps to board, walk your dog and provide home alternative to kennel services', '<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<section class="contentArea">\r\n<div class="container">\r\n<div class="row">\r\n<div class="col-md-12">\r\n<div class="borderbottom">\r\n<div class="highlights">\r\n<h2>About Us</h2>\r\n<p class="Highlighted"><strong><span class="example1 example2" style="color: #000000;">Founded in 2017, Palcura connects pet owners, pet sitters, and pet borrowers in a one-stop service to provide loving care for dogs, cats, and all types of pets.</span></strong></p>\r\n</div>\r\n<div class="sthumb"><img src="images/img-1.png" alt="" /></div>\r\n<p style="text-align: left;"><span style="background-color: #ffffff; color: #000000;">Palcura was born through our own experience with our dog. One of us was petrified of dogs and wasn&rsquo;t sure a pet would be a good fit to our lifestyle. We were lucky to have friends who left their pets with us to take care of for few hours/days and we fell in love with the idea of having a pet. After years of convincing and then &ldquo;practicing&rdquo; with friend&rsquo;s pets, we decided to visit the Humane Society. As we stood looking into a room filled with dogs, a small skinny beagle-labrador puppy jumping up and down in excitement stole our hearts. <strong><span style="color: #ff6600;">Our fur baby came home with us that day.</span></strong></span></p>\r\n<p><span class="example2" style="color: #000000;">The first time we traveled, we boarded him at a &ldquo;pet resort.&rdquo; When we picked him up, he was traumatized and had a bloody nose from rubbing it against his crate. After research, we found this may have been caused by his anxiety of being in a crate or with other pets he did not know. On our next trip, we boarded him at a new kennel. Again, he came back with cuts on his nose and this time a kennel cough as well. We know this is not the case for all animals, but we also know it is difficult to provide the same love and care the pets are used to when there are dozens of other animals at kennels and resorts.</span></p>\r\n<p><span style="color: #000000;">The answer is Palcura. Pal (friend) Cura (care) serves many purposes for animal lovers. </span><strong><span style="color: #ff6600;">For </span><a href="../../../site/signup" target="_blank">pet owners</a></strong>, <span style="color: #000000;">it connects you with loving, experienced, and vetted pet sitters/care providers so you can have peace of mind when traveling.</span> <span style="color: #ff6600;"><strong>For </strong></span><strong><a href="../../../site/signup" target="_blank">pet&nbsp;sitters</a></strong><span style="color: #000000;">, it lets you provide loving care for a pet and also make money at the same time.&nbsp;</span><span style="color: #ff6600;"><strong>For </strong></span><strong><a href="../../../site/signup" target="_blank">pet&nbsp; borrowers</a></strong><span style="color: #000000;">, it gives you the ability to care for and have the love of a well-trained pet for a few days/weeks if you are unable to have a pet full-time or if you want to see how a pet or the breed of pet that fits your lifestyle. We were lucky enough to have friends who were willing to share the love of their pets with us. We wanted to share this same experience with others through our borrowing program with a hope that greater number of families will adopt/rescue pets from shelters.</span><span class="example1"> <strong><br /></strong></span></p>\r\n<p><span style="color: #000000;">At Palcura, we want to ensure that your pet is in a loving home and/or cared for by someone who loves them just as much as you do. As pet owners ourselves, we know your pet is part of the family. Likewise, we want to make it easy to share the joy of pet ownership with others who may have always wanted a pet, but are hesitant for one reason or another. Through this, we know that <span style="color: #ff6600;"><strong>no pet will be left behind</strong></span>, and your pet will always have the loving care they deserve.</span></p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class="row">\r\n<div class="col-xs-12">\r\n<div class="bottom3">\r\n<h3>Loyalty and Rewards Program</h3>\r\n<div class="twoCol">\r\n<div class="row">\r\n<div class="col-lg-6 col-md-6 col-sm-6 col-xs-12" style="text-align: center;">\r\n<div><button class="orangebtn" style="float: none; display: inline-block; margin: 0px 7px 21px; border-radius: 7px; width: 230px; text-align: center; font-size: 12px; color: #fff; letter-spacing: 1px; font-family: ''montserratextrabold''; text-transform: uppercase; padding: 13px 30px;">Owner</button> <button class="yellowbtn" style="float: none; display: inline-block; margin: 0px 7px 21px; border-radius: 7px; width: 230px; text-align: center; font-size: 12px; color: #fff; letter-spacing: 1px; font-family: ''montserratextrabold''; text-transform: uppercase; padding: 13px 30px;">Borrower</button></div>\r\n<div class="leftColorCol">\r\n<p><strong>$1 spent = 1 point earned *</strong></p>\r\n<p>Earn 500 points and get $5 credit!</p>\r\n<p>Earn 1000 points and get $10 credit!</p>\r\n<p>You get the idea! You can use the credits for your next service. We also offer coupons for veterinarian visits, pet specialty stores, groomers, trainers near you! **</p>\r\n</div>\r\n</div>\r\n<div class="col-lg-6 col-md-6 col-sm-6 col-xs-12" style="text-align: center;">\r\n<div><button class="orangebtn" style="float: none; display: inline-block; margin: 0px 7px 21px; border-radius: 7px; width: 340px; text-align: center; font-size: 12px; color: #fff; letter-spacing: 1px; font-family: ''montserratextrabold''; text-transform: uppercase; padding: 13px 30px;">Sitter</button></div>\r\n<div class="rightColorCol">\r\n<p><strong>We have the lowest service fee in the market. That means more money in your pocket.</strong></p>\r\n<p>50 days or more of total sitting days/service days and you become our <strong>VIP member</strong>!</p>\r\n<p>What does that mean for you? : <strong>1.5% discount off our service fees for every transaction!</strong> ***</p>\r\n</div>\r\n</div>\r\n<div class="col-lg-12 col-md-12 col-sm-12 col-xs-12" style="margin-top: 25px;">\r\n<p class="sapBlock"><strong>Pet Parents</strong> (Owners) who reserve a service for their pet through PalCura are willing to go the extra mile in making sure that their Pal gets the loving care that they truly deserve. At PalCura, we believe the care should be rewarded and for <strong>every $1 you spend</strong> in reserving a service for your pet, <strong>you earn 1 point</strong>. For <strong>every 500 points you earn, get $5 as credit</strong> that can be used to reserve the next care for your pet. Earn upto 2000 points ($20) and use it towards reservation at PalCura.com</p>\r\n<p class="sapBlock"><strong>Owners deserve a lot more and points are good, but not enough</strong>. Being Pet owners ourselves, we understand. <strong>We have partnered</strong> with exclusive organic Pet Food stores, Veterinarians, Groomers, Trainers <strong>that offer coupons and discount codes</strong> that you can use to buy specific products or services for your Pal!</p>\r\n<p class="sapBlock"><strong>Pet Borrowers</strong> (future owners) who are willing to take the first step towards pet ownership or want to fill a void in their space and love pets, deserve to get rewarded for that first step! Taking that one step forward in ownership is a big deal and we want to ensure you are rewarded for the same. For <strong>every $1 you spend </strong>in borrowing a pet, you will <strong>earn 1 point</strong>. For <strong>every 500 points you earn, get $5 as credit</strong> that can be used towards your next borrowing service. Earn up to 2000 points ($20) and use it towards reservation at PalCura.com. If borrowing gave you the confidence in rescuing a pet or owning a pet, you can use the credit towards sitting, walking and other services and continue to earn points!</p>\r\n<p class="sapBlock"><strong>Pet Care Providers, </strong>Pet Sitters, Dog Walkers, Day Care providers are the back bone of PalCura services. At PalCura, we want to reward the service providers for their loyalty and extended services. After 50 days of services, you will automatically become a part of PalCura Family VIP member and receive 1.5% off our service fees for every transaction for life, as long as you maintain the verification badge.&nbsp;</p>\r\n<p>* <em>Points expire after 12 months. You can accumulate up to 2000 points at a time. Points will stop accumulating after 2000 points and you will have an option to convert the points to credit for booking a service.</em></p>\r\n<p><em>** Coupons are made available through partnership with local businesses. Coupons, if available, will be emailed after every second transaction.<strong><br /></strong></em></p>\r\n<p><em>*** As long as you maintain your verification badge, you will get a 1.5% discount for every transaction for being our PalCura Family VIP member.</em></p>\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n</body>\r\n</html>', '2018-04-22 06:45:29', 'Active', ''),
