(13, 'Mission', 'Mission', 'Page', '', '', 'mission', '', '<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<section class="contentArea">\r\n<div class="container">\r\n<div class="container">\r\n<div class="row">\r\n<div class="col-md-12">\r\n<p>We are an online marketplace connecting Pet Parents with Pet Borrowers and Pet Sitters. At PalCura, we want to ensure that your pet is in a loving home and/or cared for by someone who loves them just as much as you do. As pet owners ourselves, we know your pet is a part of the family. Likewise, we want to make it easy to share the joy of pet ownership with others who may have always wanted a pet, but are hesitant for one reason or another. Through this, we know that no pet will be left behind, and your pet will always have the loving care they deserve. Read more to see how our mission alignts with your needs</p>\r\n</div>\r\n</div>\r\n<div class="row">\r\n<div class="col-xs-12">\r\n<div class="bottom3">\r\n<h3 class="orangeBtn">Pet owners</h3>\r\n<div class="twoCol">\r\n<div class="row">\r\n<div class="col-lg-4 col-md-6 col-sm-6 col-xs-12">\r\n<div class="sthumb"><img src="images/ownerpic.png" alt="" /></div>\r\n</div>\r\n<div class="col-lg-8 col-md-6 col-sm-6 col-xs-12">\r\n<div class="rightColorCol">\r\n<p>&ldquo;My Little dog &ndash; a heartbeat at my feet&rdquo; &ndash; <strong>Edith Wharton</strong></p>\r\n<p>&nbsp;&ldquo;If animals could speak, the dog would be a blundering outspoken fellow; but the cat would have the rare grace of never saying a word too much&rdquo; &ndash; <strong>Mark Twain</strong></p>\r\n<p>&nbsp;Birds are the best pets around&rdquo; &ndash; <strong>Bird</strong>.</p>\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>\r\n</div>\r\n<p>Owners, who are willing to share the love of their pet, can also lend their pets and drive pet adoption and ownership! Our pet borrowing program is designed to connect you with nearby borrowers. You can help borrowers gain confidence by giving them a fun filled vision to the future. You can also help borrowers give tips on pet care, training, and more, all while earning money!&nbsp;</p>\r\n<p><strong>What&rsquo;s your challenge or need?</strong></p>\r\n<div class="col-lg-6 col-md-6 col-sm-6 col-xs-12">\r\n<ul>\r\n<li>\r\n<p>Going for a vacation but can&rsquo; take your pal?</p>\r\n</li>\r\n<li>\r\n<p>Tired of Kennel services?</p>\r\n</li>\r\n<li>\r\n<p>Do not want your pet to be in a crate?</p>\r\n</li>\r\n<li>\r\n<p>Too expensive to board your pal at a Kennel or hotel?</p>\r\n</li>\r\n<li>\r\n<p>Need someone to just walk your dog?&nbsp;</p>\r\n</li>\r\n</ul>\r\n</div>\r\n<div class="col-lg-6 col-md-6 col-sm-6 col-xs-12">\r\n<ul>\r\n<li>\r\n<p>Need a day care for your cat?</p>\r\n</li>\r\n<li>\r\n<p>Want someone to feed your birds while you are out?</p>\r\n</li>\r\n<li>\r\n<p>Want to board your pet in a house?</p>\r\n</li>\r\n<li>\r\n<p>Want a care for your pet with undivided attention?</p>\r\n</li>\r\n<li>\r\n<p>Going for a day trip and need a day care for your pal?</p>\r\n</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class="container">\r\n<div class="row">\r\n<div class="col-xs-12">\r\n<div class="bottom3">\r\n<div class="twoCol">\r\n<p>Look no further! &ndash; Sign up and search for nearby sitters, walkers, in-house service providers that will take care of your pet care needs and make sure to provide undivided attention. We want to make sure that your pet is in a loving home or cared for by someone who loves them just as you. We make it easy to arrange walks, home visits, playtime, visits to the park, and overnight stays or holidays. Schedule a meet and greet or video call to make sure your pet will be in a loving home. When you are away, you will be updated in real-time about all the activities!</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class="row">\r\n<div class="col-xs-12">\r\n<div class="bottom3">\r\n<h3 class="orangeBtn">Pet Borrowers</h3>\r\n<div class="twoCol">\r\n<div class="row">\r\n<div class="col-lg-4 col-md-6 col-sm-6 col-xs-12">\r\n<div class="sthumb"><img src="images/boorrowepic.png" alt="" /></div>\r\n</div>\r\n<div class="col-lg-8 col-md-6 col-sm-6 col-xs-12">\r\n<div class="rightColorCol">\r\n<p>&ldquo; Before you get a dog, you can&rsquo;t imagine what living with one might be like; afterward, you can&rsquo;t imagine living any other way&rdquo; &ndash; <strong>Caroline Knapp</strong></p>\r\n<p>&ldquo;I used to love dogs until I discovered cats.&rdquo; &ndash; <strong>Nafisa Joseph</strong></p>\r\n<p>&ldquo;There are many reasons why so many of us choose to share our lives with a pet--it''s the perfect antidote for loneliness, providing an endless supply of smiles and the certainty of unwavering companionship, and many of us have seen the way a pet can make a family feel whole&rdquo; &ndash; <strong>Nick Trout</strong></p>\r\n</div>\r\n</div>\r\n</div>\r\n<p>Do you love pets? Ever imagined being a parent of a bundle of energy or a cuddly (ahem...lazy: D) pet? Adopting or buying a pet is a huge step in one&rsquo;s life. Let us help you make that call! You can see how a pet fits in your lifestyle and the breed and type of pet that suits you. If you are in college and miss your family pet, borrow a pet and share the love</p>\r\n<p>Borrowing a pet program is aimed towards families that hesitate in getting a pet because they are not sure if they can handle the lifestyle commitment of a pet. Many are not sure of the kind/breed of pet that suits their living conditions and lifestyles or many live away from their family pet and miss the wag of a tail when they get home, and we understand.</p>\r\n<p>We were lucky enough to have friends who were willing to share the love of their pets with us. We wanted to share this same experience with others through our borrowing program with a hope that greater number of families will adopt/rescue pets from shelters. Feeling the murmur of a purr beneath your fingers and holding a furry warm companion close, brings instant contentment&mdash;no wonder the experts say that a pet is a stress-buster.</p>\r\n<p>Our pet borrowing program is designed to connect you with pets in the neighborhood...be it for few days or to just play and take to the park. When you rent a pet from existing owner, you get the comfort in the fact that the pet is well behaved, has been well taken care of by the owner. You get to see the future today! Someone is always looking to fill the pet void in their life by spending time with one and they can help out owners at the same time.</p>\r\n<p>Owners who are willing to rent their trained pets get an opportunity to share the love of their pet and feel proud when borrowers eventually take the leap towards ownership. Owners also get an opportunity to earn money while sharing the love of their pet!</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class="row">\r\n<div class="col-xs-12">\r\n<div class="bottom3">\r\n<h3 class="orangeBtn">Pet SITTERS</h3>\r\n<div class="twoCol">\r\n<div class="row">\r\n<div class="col-lg-4 col-md-6 col-sm-6 col-xs-12">\r\n<div class="sthumb"><img src="images/sitterpic.png" alt="" /></div>\r\n</div>\r\n<div class="col-lg-8 col-md-6 col-sm-6 col-xs-12">\r\n<div class="rightColorCol">\r\n<p>&ldquo;Money can buy you a fine dog, but only love can make him wag his tail&rdquo; &ndash; <strong>Kinky Friedman</strong></p>\r\n<p>&ldquo;Time spent with cats is never wasted&rdquo;- <strong>Sigmund Freud</strong></p>\r\n<p>&ldquo;Until one has loved an animal a part of one&rsquo;s soul remains unawakened&rdquo; &ndash; <strong>Anatole France</strong></p>\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>\r\n</div>\r\n<p>Love Pets and would like to earn money by caring for one? Want a frequent companion for your pet? Imagine the additional fun in your home, the additional wag of tails. Now imagine you taking care of someone&rsquo;s loved pet, giving the owners a peace of mind while they are travelling. What if you had a chance to do all of the above, multiply the love, and earn money while doing what you love? Wouldn&rsquo;t you be excited? We bet you would! Our platform allows you to connect with Pet Owners who are looking for help in a simple three step process &ndash; sign up, connect, and care for the pet while earning money!</p>\r\n<p>If you earn money doing what you love, it&rsquo;s not work anymore. Start your own small business and do this full time or part time. Help share the care and multiply the love!</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n</body>\r\n</html>', '2018-02-05 10:52:10', 'Active', '');
