(14, 'Privacy Policy', 'Privacy Policy', 'Page', '', '', 'Privacy-Policy', '', '<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<section class="contentArea">\r\n<div class="container">\r\n<div class="row">\r\n<div class="col-xs-12">\r\n<div class="bottom3">\r\n<h2 class="Highlighted" style="text-align: center;">The Privacy Policy below is effective for all users</h2>\r\n<h2 class="Highlighted" style="text-align: center;">(Last Updated on October 1, 2017)</h2>\r\n</div>\r\n</div>\r\n</div>\r\n<div class="row">\r\n<div class="col-xs-12">\r\n<div class="bottom3">\r\n<h3>PalCura, LLC Privacy Policy</h3>\r\n<p>PalCura (&ldquo;PalCura&rdquo;, &ldquo;We&rdquo;, or &ldquo;Us&rdquo;), a limited liability company formed and operating under the laws of the state of Florida, operates <a class="contentct" href="http://www.palcura.com" target="_blank">http://www.palcura.com</a> website and mobile application (together and separately referred to as &ldquo;Service&rdquo;). PalCura takes the privacy of those visiting our website (&ldquo;Users&rdquo; or &ldquo;you&rdquo;) very seriously. This page informs you of our policies regarding the collection, use and disclosure of Personal Information when you use our Service because Users have the right to know what information we collect, how it is protected and used, and the circumstances under which it may be disclosed. This Policy describes the various ways that we collect and treat information and content provided by Users so as to enhance your use of our services while at the same time protect your privacy. Please read this Policy carefully, as your use of PalCura services constitutes your acceptance of and agreement to the terms and conditions of the Policy. Do not use our services if you do not agree with the terms and conditions of the Policy. This Policy does not cover information collected other than on or through the Website, including without limitation offline and on sites linked to from the Website and application. It does however cover social media accounts of PalCura. This Policy may be modified from time to time without advance notice. Continued use of our services by you will constitute your acceptance of any changes or revisions to the Policy.</p>\r\n</div>\r\n<div class="bottom3">\r\n<h3>I. Type of Information We Collect</h3>\r\n<p>Our services collect the following personally identifying information: name, email address, mailing address, telephone number, payment information, and age.</p>\r\n<p>We may collect and store any personal information you enter on our website or provide to us in some other manner. This includes identifying information, such as your name, address, e-mail address, and telephone number; and, if you transact business with us, financial information such as your payment method (valid credit card number, type, expiration date or other financial information). We also may request information about your interests and activities, your gender and age, and other demographic information.</p>\r\n<p>Our servers may also collect information regarding your usage of our services, including without limitation the pages you visit, the browser software and operating system you use, your internet service provider, your Internet Protocol address, referring / exit pages, date / time stamp and clickstream data. Additionally, the Services utilize user-specific analytics that measure individual use of the site, including but not limited to which videos have been viewed, internal pages visited, duration of visit, and user comments.</p>\r\n<p>We may supplement the information we collect about you online with outside records from third parties to enhance our ability to serve you, to tailor our content to you, and to offer you opportunities to purchase products or services that we believe may be of interest to you. We may combine the information we receive from those sources with information we collect through our services. In those cases, we will apply this Policy to any information received from third parties, unless we have disclosed otherwise.</p>\r\n</div>\r\n<div class="bottom3">\r\n<h3>B. How We Use The Information We Collect</h3>\r\n<p>Unless you have opted out of receiving promotional materials or notifications from us, we may periodically use your email address to send you such materials and notifications. If you want to stop receiving such materials and notifications from us, you can contact us at the information below to alert us to your preference. In addition, you can opt out of, or unsubscribe from, receipt of such e-mails at any time by following the instructions contained in those e-mails.</p>\r\n<p>By submitting Social Media Content via any social media provider, you (i) disclaim any ownership under any copyright right, privacy or publicity right, attribution right or any other right over, relating to or concerning any such Social Media Content and (ii) expressly authorize and license us to reproduce, print, publish and disseminate any such Social Media Content on the Website or in any other media for any purpose. Such authorization and license are in perpetuity and effective in any and all jurisdictions, meaning we may forever reproduce, print and disseminate any such Social Media Content on the Website or in any other media for any purpose.</p>\r\n<p>We also allow access to our database by third parties that provide us with services but only to the extent necessary to provide those services. Your information may be provided to third parties that manage or administer certain sections or features of the Website and mobile application, in which case the information may be used by us and by any such third party, each pursuant to its own policies. We may also provide your information to our advertisers, so that they can serve ads to you that meet your needs or match your interests. While we will seek to require such third parties to follow appropriate privacy policies and will not authorize them to use this information except for the express purpose for which it is provided, we do not bear any responsibility for any actions or policies of third parties. To the extent we are legally required to provide access to our database in order to cooperate with police investigations or other legal proceedings, in those instances, the information is provided only for that purpose.</p>\r\n</div>\r\n<div class="bottom3">\r\n<h3>C. Third Parties</h3>\r\n<p>If you provide us with your personal information, we may transfer that information to our third-party service providers. The services provided by our third-party service providers may include payment processing and marketing assistance, performing business and sales analysis, supporting our website functionality, and supporting contests, surveys and other features offered through our Website. We also share your name, contact information and credit card information with our authorized service providers who process credit card payments. These service providers may have access to personal information needed to perform their functions, and will process it in accordance with their privacy policies. Our current credit card service provider is Stripe. We recommend reading their privacy policy.</p>\r\n<p>We also use automated devices and applications to evaluate the use of our websites and the service we provide. We use these tools to gather information about users to help us improve our services, performance and user experiences. These analytics providers may use cookies and other technologies to perform their services, and may combine the information that they collect about you on our websites with other information that they have collected. This Policy does not cover such third parties&rsquo; use of the data.</p>\r\n<p>PalCura may also disclose your information if required to do so by law, court order, subpoena or other legal process, as requested by a governmental or law enforcement authority.</p>\r\n</div>\r\n<div class="bottom3">\r\n<h3>D. Additional Web Site Viewing Information</h3>\r\n<p>The Website may use cookies (i.e., files / information placed by a website on your computer to facilitate future use) internally, they may be used by third parties such as network advertisers to serve advertisements and may use third-party analytics service providers to evaluate and provide us with information about the use of our Service and viewing of our content. Network advertisers are third parties that display advertisements based on your visits to the website and other web sites you have visited. The Services&rsquo; third-party ad network providers, the advertisers, the sponsors and/or traffic measurement services may themselves set and access their own cookies, web beacons and other tracking technologies on the device you use to access the Service and track certain behavioral information regarding users of your device through a device identifier. These third-party cookies, web beacons and other tracking technologies are set to, among other things: help deliver advertisements to you that you might be interested in; prevent you from seeing the same advertisements too many times; and understand the usefulness to you of the advertisements that have been delivered to you. Any images (or any other parts of a web page) delivered by third parties in association with third-party cookies may serve as web beacons, which enable third parties to carry out the previously described activities. Third party cookies and web beacons are governed by each third party&rsquo;s specific privacy policy, not this Policy.</p>\r\n<p>If you don&rsquo;t want any cookies, your web browser likely includes an option that allows you to not accept them. Our services may contain links to and content from other websites, and those third parties may collect website usage information and information that identifies the computer or device you are using when web pages from our Service is sent to your browser. Such linked web sites are not under our control and we are not responsible for the contents of any such linked sites, any link contained in such linked sites, or any changes or updates to such sites. Links to any third-party websites are provided only as a convenience. We do not endorse any link made available through our Services that is not affiliated with Pythea. We encourage all users of our Services to read the privacy policies of each and every website visited when linking directly from our Service.</p>\r\n</div>\r\n<div class="bottom3">\r\n<h3>E. How You Can Access Your Information</h3>\r\n<p>If you have an online account with us, you have the ability to review and update your personal information online by logging into your account. You can also review and update your personal information by contacting us. More information about how to contact us is provided below.</p>\r\n<p>If you have an account with us, you also may choose to close your account (and remove any of your content) at any time by following the directions provided&nbsp;here&nbsp;or contacting customer support at:&nbsp;<a class="contentct" href="mailto:admin@palcura.com">admin@palcura.com</a>. After you close your account, you will not be able to sign in to our website or access any of your personal information. However, you can open a new account at any time. If you close your account, we may still retain certain information associated with your account for analytical purposes and recordkeeping integrity, as well as to prevent fraud, collect any fees owed, enforce our terms and conditions, take actions we deem necessary to protect the integrity of our website or our users, or take other actions otherwise permitted by law. In addition, if certain information has already been provided to third parties as described in this Privacy Policy, retention of that information will be subject to those third parties&rsquo; policies.</p>\r\n<p>This Policy applies only to information collected by the Website.</p>\r\n</div>\r\n<div class="bottom3">\r\n<h3>F. Use of Website By Children</h3>\r\n<p>This Website is not intended for use by children. No one under age 18 is allowed to provide any personal information (including e-mail addresses) or Social Media Content.</p>\r\n</div>\r\n<div class="bottom3">\r\n<h3>G. Changes to This Policy</h3>\r\n<p>We will occasionally update this Privacy Policy to reflect changes in our practices and services. When we post changes to this Privacy Policy, we will revise the "Last Updated" date at the top of this Privacy Policy. If we make any material changes in the way we collect, use, and/or share your personal information, we will notify you by sending an email to the email address you most recently provided us in your account, profile or registration (unless we do not have such an email address), and/or by prominently posting notice of the changes on our website. We recommend that you check our website from time to time to inform yourself of any changes in this Privacy Policy or any of our other policies.</p>\r\n</div>\r\n<div class="bottom3">\r\n<h3>H. Contact Information</h3>\r\n<p>If you have any questions about this Policy, please contact us at address or telephone number listed below:</p>\r\n<p>PalCura , LLC <br /> 160 W. Camino Real<br /> Unit #533<br /> Boca Raton, FL 33432<br /> Or email us at <a class="contentct" href="mailto:hello@palcura.com">hello@palcura.com</a></p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n</body>\r\n</html>', '2018-02-03 05:43:29', 'Active', ''),
(17, 'createsitter', 'createsitter', 'Page', '', '', 'createsitter', '', '<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<div class="row">\r\n<div class="marginBlock">\r\n<div class="col-md-8 col-sm-8 col-xs-12">\r\n<div class="signBlock">\r\n<div class="signText">\r\n<h2>Create a free profile</h2>\r\n<div class="col-md-8 col-sm-8 col-xs-12">\r\n<div class="signBlock">\r\n<div class="signText">\r\n<p><span style="color: #ff0000;">All details of Palcura registered sitters are verified to make sure every pet has a loving home</span></p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class="col-md-4 col-sm-4 col-xs-12">&nbsp;</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class="col-md-4 col-sm-4 col-xs-12">\r\n<div class="signThumb"><img class="img-responsive" src="images/signup.png" alt="" /></div>\r\n</div>\r\n</div>\r\n</div>\r\n</body>\r\n</html>', '2018-04-24 09:42:00', 'Active', ''),
(18, 'connect', 'connect', 'Page', '', '', 'connect', '', '<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<div class="row">\r\n<div class="marginBlock noMargin">\r\n<div class="col-md-2 col-sm-3 col-xs-12 noPad">\r\n<div class="signThumb"><img class="img-responsive" src="images/connect.png" alt="" /></div>\r\n</div>\r\n<div class="col-md-8 col-sm-9 col-xs-12">\r\n<div class="signBlock connectBlock"><br />\r\n<div class="signText">\r\n<h2>2. Connect</h2>\r\n<p>Before booking a service. get to know your pet sitter through our online video call system or you can even schedule to meet your sitter in person. All sitters go through a verification process to help <a style="color: #ff8447;" href="connect">find the best person for the job!M</a></p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</body>\r\n</html>', '2018-06-25 02:20:56', 'Active', ''),
(19, 'book', 'book', 'Page', '', '', 'book', '', '<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<div class="row">\r\n<div class="marginBlock noMargin">\r\n<div class="col-md-2 col-sm-3 col-xs-12 noPad">\r\n<div class="signThumb"><img class="img-responsive" src="images/share.png" alt="" /></div>\r\n</div>\r\n<div class="col-md-8 col-sm-9 col-xs-12">\r\n<div class="signBlock shareBlock">\r\n<div class="signText">\r\n<h2>Schedule</h2>\r\n<p><label>Schedule on-demand pet services</label> when you need them. Choose from a wide variety including dog walkers, cat sitters, boarding, doggy daycares, house sitting. You name it, we have someone who can help!</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</body>\r\n</html>', '2018-06-22 03:32:06', 'Active', ''),
